import React from "react";
import "./ItemListContainer.css";
import { useState, useEffect } from "react";

const ItemListContainer = ({ greeting }) => {
  return (
    <div className="greeting">
      <h2>{greeting}</h2>
    </div>
  );
};

export default ItemListContainer;
